import React, { useState } from 'react';
import axios from 'axios';

const API_URL = "http://localhost:5000/api/profile";

function CarManager({ userData, setUser }) {
  const [isAddingCar, setIsAddingCar] = useState(false);
  const [newCar, setNewCar] = useState({
    plateNumber: '',
    model: '',
    color: '',
    seats: ''
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewCar({ ...newCar, [name]: value });
  };

  const handleAddCar = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    // Simple validation
    if (!newCar.plateNumber || !newCar.model || !newCar.color) {
      setError('Please fill in all required fields');
      return;
    }

    const token = localStorage.getItem('token');
    
    try {
      const response = await axios.post(
        `${API_URL}/add-car`, 
        newCar, 
        { headers: { Authorization: `Bearer ${token}` } }
      );

      // Create updated car with ID from response
      const addedCar = {
        id: response.data.id,
        user_id: userData.id,
        plate_number: newCar.plateNumber,
        model: newCar.model, 
        color: newCar.color,
        seats: newCar.seats
      };

      // Update local user context with the new car
      const updatedUserData = { 
        ...userData,
        cars: userData.cars ? [...userData.cars, addedCar] : [addedCar]
      };
      
      setUser(updatedUserData);
      setSuccess('Car added successfully');
      
      // Reset form
      setNewCar({
        plateNumber: '',
        model: '',
        color: '',
        seats: ''
      });
      
      // Close the form after successful submission
      setIsAddingCar(false);
    } catch (err) {
      console.error('Error adding car:', err);
      setError(err.response?.data?.message || 'Failed to add car');
    }
  };

  const handleDeleteCar = async (carId) => {
    if (!window.confirm('Are you sure you want to delete this car?')) {
      return;
    }

    const token = localStorage.getItem('token');
    
    try {
      await axios.delete(
        `${API_URL}/delete-car/${carId}`, 
        { headers: { Authorization: `Bearer ${token}` } }
      );

      // Update local user context by removing the deleted car
      const updatedCars = userData.cars.filter(car => car.id !== carId);
      const updatedUserData = { ...userData, cars: updatedCars };
      
      setUser(updatedUserData);
      setSuccess('Car deleted successfully');
    } catch (err) {
      console.error('Error deleting car:', err);
      setError(err.response?.data?.message || 'Failed to delete car');
    }
  };

  // Reset messages when toggling the form
  const toggleAddCar = () => {
    setIsAddingCar(!isAddingCar);
    setError('');
    setSuccess('');
  };

  return (
    <div className="car-manager">
      <h3>My Vehicles</h3>
      
      {error && <div className="error-message">{error}</div>}
      {success && <div className="success-message">{success}</div>}
      
      {userData.cars && userData.cars.length > 0 ? (
        <div className="cars-list">
          {userData.cars.map(car => (
            <div key={car.id} className="car-item">
              <div className="car-details">
                <p><strong>Plate:</strong> {car.plate_number}</p>
                <p><strong>Model:</strong> {car.model}</p>
                <p><strong>Color:</strong> {car.color}</p>
                {car.seats && <p><strong>Seats:</strong> {car.seats}</p>}
              </div>
              <button 
                className="delete-car-button" 
                onClick={() => handleDeleteCar(car.id)}
              >
                Delete
              </button>
            </div>
          ))}
        </div>
      ) : (
        <p>You haven't added any vehicles yet.</p>
      )}
      
      {!isAddingCar ? (
        <button className="add-car-button" onClick={toggleAddCar}>
          Add New Vehicle
        </button>
      ) : (
        <div className="add-car-form">
          <h4>Add New Vehicle</h4>
          <form onSubmit={handleAddCar}>
            <div className="form-group">
              <label>Plate Number*</label>
              <input
                type="text"
                name="plateNumber"
                value={newCar.plateNumber}
                onChange={handleInputChange}
                required
              />
            </div>
            <div className="form-group">
              <label>Model*</label>
              <input
                type="text"
                name="model"
                value={newCar.model}
                onChange={handleInputChange}
                required
              />
            </div>
            <div className="form-group">
              <label>Color*</label>
              <input
                type="text"
                name="color"
                value={newCar.color}
                onChange={handleInputChange}
                required
              />
            </div>
            <div className="form-group">
              <label>Seats</label>
              <input
                type="number"
                name="seats"
                value={newCar.seats}
                onChange={handleInputChange}
              />
            </div>
            <div className="form-actions">
              <button type="submit" className="submit-button">
                Add Vehicle
              </button>
              <button 
                type="button" 
                className="cancel-button" 
                onClick={toggleAddCar}
              >
                Cancel
              </button>
            </div>
          </form>
        </div>
      )}
    </div>
  );
}

export default CarManager;
